as eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"107709","type":"Paragraph"},{"attributes":{"below":[{"id":"105811"}],"center":[{"id":"105814"},{"id":"105818"},{"id":"106383"}],"left":[{"id":"105815"}],"plot_height":320,"renderers":[{"id":"106356"},{"id":"106361"},{"id":"106942"},{"id":"106947"},{"id":"107593"},{"id":"107598"}],"title":{"id":"105801"},"toolbar":{"id":"105826"},"x_range":{"id":"105803"},"x_scale":{"id":"105807"},"y_range":{"id":"105805"},"y_scale":{"id":"105809"}},"id":"105800","subtype":"Figure","type":"Plot"},{"attributes":{"data_source":{"id":"106038"},"glyph":{"id":"106039"},"hover_glyph":null,"muted_glyph":null,"name":" Mato Grosso do Sul","nonselection_glyph":{"id":"106040"},"selection_glyph":null,"view":{"id":"106042"}},"id":"106041","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":0.5},"x":{"field":"x"},"y":{"field":"y"}},"id":"105907","type":"Circle"},{"attributes":{},"id":"1
